import AppBar from "@material-ui/core/AppBar";
import IconButton from "@material-ui/core/IconButton";
import MenuIcon from "@material-ui/icons/Menu";
import MenuItem from "@material-ui/icons/Menu";
import React from "react";
import Drawer from "@material-ui/core/Drawer";
import { withStyles } from "@material-ui/core/styles";
import List from "@material-ui/core/List";
import Divider from "@material-ui/core/Divider";
import ListItem from "@material-ui/core/ListItem";
import ListItemIcon from "@material-ui/core/ListItemIcon";
import ListItemText from "@material-ui/core/ListItemText";
import InboxIcon from "@material-ui/icons/MoveToInbox";
import MailIcon from "@material-ui/icons/Mail";
const styles = {
  root: {
    flexGrow: 1
  },
  menuButton: {
    marginRight: "auto"
  }
};
interface Iprops {
  classes: {
    root: string;
    menuButton: string;
  };
}
interface Istate {
  toggle: boolean;
}
class TemporaryDrawer extends React.Component<Iprops, Istate> {
  state = {
    toggle: false
  };
  handleDrawerToggle = () => this.setState({ toggle: !this.state.toggle });
  sideList = () => {
    const { classes } = this.props;
    return (
      <div className={classes.root} onClick={this.handleDrawerToggle}>
        <List>
          {["로그인", "로그아웃", "게시판1", "게시판2"].map((text, index) => (
            <ListItem button key={text}>
              <ListItemIcon>
                {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
              </ListItemIcon>
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
        <Divider />
        <List>
          {["만든이", "설정", "통계"].map((text, index) => (
            <ListItem button key={text}>
              <ListItemIcon>
                {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
              </ListItemIcon>
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
      </div>
    );
  };
  render() {
    const { classes } = this.props;
    return (
      <div>
        <AppBar position="static">
          <IconButton
            className={classes.menuButton}
            color="inherit"
            onClick={this.handleDrawerToggle}
          >
            <MenuIcon />
          </IconButton>
        </AppBar>
        <Drawer open={this.state.toggle}>
          <MenuItem onClick={this.handleDrawerToggle}>{this.sideList}</MenuItem>
        </Drawer>
      </div>
    );
  }
}
export default withStyles(styles)(TemporaryDrawer);
